import React from 'react';
import './DiamondGrid.css';

/*Single diamond*/
function Diamond({ image }) {
  return (
    <div className="diamond">
      <img src={image} alt="Highlights of the year" />
    </div>
  );
}

/*Diamond Grid*/
function DiamondGrid({ images }) {
  return (
    <div className="diamond-grid">
      {images.map((row, i) => (
        <div key={i} className="diamond-row">
          {row.map((image, j) => (
            <Diamond key={j} image={image} />
          ))}
        </div>
      ))}
    </div>
  );
}

export default DiamondGrid;
